/* harmony default export */ __webpack_exports__["default"] = ("<div class=\"custom-padding\">\n  <div class=\"container\">\n    <h1 class=\"page-title\">Committees</h1>\n    <div class=\"content\">\n      <p>You can become an active member of H.V. Ockham by joining one or more committees. There are many committees with different kinds of activities, tasks and responsibilities. You can find an overview of our committees below. Joining a committee at our association is fun; you get to meet your fellow students from beyond your own track! If you would like to join a committee, please send us a message via <a href=\"mailto:board@hvockham.nl\">board@hvockham.nl</a></p><br><br>\n      <h2>ACCIE</h2>\n      <p>The ACCIE is the committee that is responsible for fun activities. From lasertag to scavenger hunts to pole dancing workshops, this committee organises it all! The ACCIE organises an activity for all H.V. Ockham members once every one or two months.<br>The current members of the ACCIE are:</p>\n      <ul>\n        <li>Mihai Tene (Chairman)</li>\n        <li>Remco Abraham</li>\n        <li>Stefan Pozinarea</li>\n        <li>Marlen Braun</li>\n        <li>Melvin Willems</li>\n        <li>Atis Kazaferi (board representative)</li>\n      </ul><br>\n      <h2>BataCie</h2>\n      <p>The BataCie is the committee that makes sure a team of H.V. Ockham participates in the annual Batavierenrace, which is usually formed with members of another honours association. However, more importantly, they also organise the Batavierenrace BBQ!</p><br>\n      <h2>DriCie</h2>\n      <p>Every second Monday of the month, the DriCie organises a drink. The drinks carry the very self-explanatory name of “Second Monday of the Month Drink” and take place right after the honours lectures in the Technobar (@Technohal).<br>The current members of the DriCie are:</p>\n      <ul>\n        <li>Lars van Arkel (Chairman)</li>\n        <li>Jurrie Bruggeman</li>\n        <li>Mihai Tene</li>\n        <li>Sven van Wincoop</li>\n        <li>Sander Oosterveld</li>\n        <li>Kenneth Weissbeek (Treasurer)</li>\n        <li>Mart Wubbles (board representative)</li>\n      </ul><br>\n      <h2>ExpediCie</h2>\n      <p>H.V. Ockham’s biggest activity is organised by the ExpediCie. Every year, they organise a trip of four days to a destination abroad (within Europe). On this trip, participants visit local and global companies, gain cultural knowledge and, above all, have lots of fun. For 2020, these members are part of the ExpediCie:</p>\n      <ul>\n        <li>Eitel Yvan Ndeh de Mbah</li>\n        <li>Thijs Bink</li>\n        <li>Tjo-Kin Man</li>\n        <li>Sander Oosterveld</li>\n        <li>Eline Uiterweerd</li>\n        <li>Remco Abraham</li>\n        <li>Melvin Willems (board representative)</li>\n      </ul><br>\n      <h2>MagaCien</h2>\n      <p>The MagaCien is responsible for publishing - you guessed it right! - a magazine. Ockham’s Razor is the magazine that is published semi-annually. The previous editions of Ockham’s Razor can be found under Association &gt; Ockham’s Razor. The members of the committee are responsible for writing interesting articles and creating beautiful layouts.<br>The current members of the MagaCien are:</p>\n      <ul>\n        <li>Eline Uiterweerd (editor-in-chief)</li>\n        <li>Thijs Bink ( Secretary)</li>\n        <li>Leon Smook</li>\n        <li>Guido Ritsema van Eck</li>\n        <li>Marie-Laure Snijders</li>\n        <li>Saskia Helmich</li>\n        <li>Saumitra Athlekar</li>\n        <li>Atis Kazaferi (board representative)</li>\n      </ul><br>\n      <h2>SympCie</h2>\n      <p>The SympCie is responsible for organising the more formal events, such as lunch lectures and dinner colloquia. The committee often invites a company, honorary member or another type of H.V. Ockham associate to come and give an interesting talk, all while enjoying lunch or dinner.<br>The current members of the SympCie are:</p>\n      <ul>\n        <li>Thijs Bink (Chairman)</li>\n        <li>Annemarte Visscher (Secretary)</li>\n        <li>Charlotte White (Tresurer)</li>\n        <li>Theresa Höfker</li>\n        <li>Aninka Spekle</li>\n        <li>Kenneth Weissbeek</li>\n        <li>Saumitra Athlekar</li>\n        <li>Marie-Laure Snijders</li>\n        <li>Atis Kazaferi (board representative)</li>\n      </ul><br>\n      <h2>TechniCie</h2>\n      <p>You would not be reading this right now if the TechniCie had not put their efforts into creating and maintaining the H.V. Ockham website. These clever guys and girls are responsible for making sure that the website stays up-to-date.<br>The current members of the TechniCie are:</p>\n      <ul>\n        <li>Tjo-Kin Man (chairman)</li>\n        <li>Dieuwke Maas</li>\n        <li>Martin Essink</li>\n        <li>Jelle Nijland</li>\n        <li>Remco Abraham</li>\n        <li>Melvin Willems (board representative)</li>\n      </ul><br>\n      <h2>LuCie</h2>\n      <p>For our dear lustrum (10 years and more of a wonderful association), this committee is in charge of organizing a series of activities representing H.V. Ockham and what it stands for: a great colorful community of the honour programme! For the lustrum of 2019 the memebrs of this committee are:</p>\n      <ul>\n        <li>Guido Ritsema van Eck (chairman)</li>\n        <li>Saumitra Athlekar (Treasurer)</li>\n        <li>Eline Uiterweerd</li>\n        <li>Hanna de Wolf</li>\n        <li>Bilge Tekeş</li>\n        <li>Atis Kazaferi (board representative)</li>\n      </ul><br>\n      <h2>Board of Advisors (BoA /RvA)</h2>\n      <p>As of October 2019, the Raad van Advies (RvA) consists of the following members:</p>\n      <ul>\n        <li>Saskia Helmich</li>\n        <li>Saumitra Athlekar</li>\n        <li>Eline Uiterweerd</li>\n        <li>Remco Abraham</li>\n        <li>Marie-Laure Snijders</li>\n      </ul><br>\n      <h2>KasCo (Financial Committee)</h2>\n      <p>As of October 2019, the Kasco consists of the following members:</p>\n      <ul>\n        <li>Guido Ritsema van Eck</li>\n        <li>Jaap Slootbeek</li>\n        <li>Pauline Oonk</li>\n      </ul>\n    </div>\n  </div>\n</div>\n");

